import React from 'react';

import Select from 'react-select';

const colourOptions =['aa', 'bb', 'cc', 'dd']
export default () => (
  <Select
    isMulti
    name="colors"
    options={colourOptions}
    className="basic-multi-select"
    classNamePrefix="select"
  />
);
